import React from 'react';
import Navigation from "../includes/Navigation/Navigation";
import Head from "next/head";

const MainLayout = props => {
    return (
        <>
            <Head>
                <title>چتروم سکسی آویزون </title>
            </Head>
            <Navigation/>
            { props.children }
        </>
    );
};

export default MainLayout;
